import { useState } from "react";

var appletView;

function Navbar() {

    return(
        
        /* NAVBAR */
        <nav id="navbar" className="navbar sticky-top navbar-expand-lg navbar-dark bg-dark">
            <div className="container-fluid">

                <div className="collapse navbar-collapse" id="navbarNav">
                
                    <ul className="navbar-nav">
                        <li className="nav-item">
                            <a className="nav-link" href="#" onClick={function(){appletView = "home"}}>Home</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#" onClick={function(){appletView = "clients"}}>Clients</a>
                        </li>
                        <li className="nav-item">
                            <a className="nav-link" href="#" onClick={function(){appletView = "new-client"}}>[Add New Client]</a>
                        </li>
                    </ul>

                </div>
                
            </div>
        </nav>
    );

};

export { appletView };
export default Navbar;
